import TypeWriterEffect from 'react-typewriter-effect';


function Home() {
    return(
      <div className="home"> 
      <div id="content">
        <img src="../images/Food.png" class="ribbon" alt="" />
      </div>
        <div className="homeBox">
          <h1 className='homeType'>

          <TypeWriterEffect

            textStyle={{ 
            fontFamily: 'Red Hat Display',
            color: '#4A5B34',
            fontWeight: 200,
            fontSize: '1.5em'
           }}
            startDelay={100}
            cursorColor="black"
            text="Welcome to Give Good"
            typeSpeed={50}
          />

          </h1>



        </div>
      </div>
  );

}

export default Home;
